        public static FlowersDTO Newfunc(string url,string imgUrl)
        {
            var data =new FlowerApi()
            {
                api_key= "oVGZrwtCqbPW4OovouZknhLfPtPnSSU4x2fRVCjxiiQ7WCGMvT",
                images = new[] { imgUrl },
                    //"data:image/jpeg;base64, JaZIhk0prxaVROns15SpV06KlXhpV06f//Z\"data:image/jpeg;base64," },
                modifiers = new[] { "crops_fast", "similar_images" },
                plant_language = "en",
                plant_details = new[] { "common_names" },
                disease_details = new[] { "common_names" },
            };

            //    //var temp=jsonco
            var flowers = new FlowersDTO();
            Client.BaseAddress = new Uri(uri);
            var cont = new StringContent(JsonConvert.SerializeObject(data), Encoding.UTF8, "application/json");

            var responseTask = Client.PostAsync(url,cont);
            responseTask.Wait();

            var result = responseTask.Result;
            if (result.IsSuccessStatusCode)
            {              
                var readTask = result.Content.ReadAsAsync<FlowersDTO>();
                readTask.Wait();

                flowers = readTask.Result;
            }
            return flowers;
        }
        
            
